import mongoose from 'mongoose';

const postSchema = new mongoose.Schema({

    title: { 
        type: String,
        required: true 
    },
    content: { 
        type: String, 
        required: true 
    },
    author: { 
        type: mongoose.Schema.Types.ObjectId, 
        ref: 'User', 
        required: true
    }

});

const Post = mongoose.model('Post', postSchema);
export default Post;
